let queryTimeRange = toscalar(requests
| summarize interval = (max(timestamp)-min(timestamp))
| project interval);
let bin_size = (tr: timespan){
    case(
        tr <= 1h, 1m,
        tr <= 24h, 10m,
        1h
        )
};
let binSize = bin_size(queryTimeRange);
let systemName = "resource-management";
let topRequests=requests
| where customDimensions["system_SystemName"] == systemName
| where operation_Name != ""
| summarize Count = count() by operation_Name
| order by Count
| top 6 by Count
| project operation_Name;
requests
| where operation_Name in (topRequests)
| where customDimensions["system_SystemName"] == systemName
| summarize Duration=percentiles(duration, 95, 99) by operation_Name, bin(timestamp,binSize)
| render timechart

